import React from 'react';

class Review extends React.Component {
    constructor() {
        super();
    }

    render() {
        const hideGrid = {
            background:'transparent',
            borderColor:'transparent'
        };

        return (
            <div className="show-grid" style={{paddingTop:50}}>
                <div className="row large-offset-1">
                    <div className="columns large-10" style={hideGrid}>
                        <h1>Classroom Set Up</h1>
                    </div>
                    <div className="columns large-2 columns_new" style={hideGrid}>
                        <Avatar title="Barbara" src="http://react.collab-ui.com/barbara.png"/>
                    </div>
                </div>
            </div>
        );
    }
}
